import React, { useContext } from 'react'
import { FullName } from './Fields'
import { Data, DataWrapContext, UseData } from './Store'

export default function Form() {
    const {data , setData} = UseData()


    return (
        <div>
            <DataWrapContext>
                {/* <FullName /> */}
                {/* <input value={data.name} placeholder="da"></input> */}
                <form onSubmit={(event) => { event.preventDefault() }}>
                    <label>Name</label>
                    <input type="text" value={data.name} onChange={(event) => { setData({ ...data, name: event.target.value }) }} placeholder="John Jonathan" name="name"></input>
                </form>
            </DataWrapContext>

        </div>
    )
}
